  false,\n\t\"url\": null,\n\t\"notes\": \"The Significant Volcanic Eruptions Database
  is a global listing of over 600 eruptions from 4360 BC to the present. A significant
  eruption is classified as one that meets at least one of the following criteria:
  caused fatalities, caused moderate damage (approximately $1 million or more), Volcanic
  Explosivity Index (VEI) of 6 or greater, generated a tsunami, or was associated
  with a significant earthquake.  The database provides information on the latitude,
  longitude, elevation, type of volcano, last known eruption, VEI index, and socio-economic
  data such as the total number of casualties, injuries, houses destroyed, and houses
  damaged, and $ dollage damage estimates. References, political geography, and additional
  comments are also provided for each eruption. If the eruption was associated with
  a tsunami or significant earthquake, it is flagged and linked to the related database.
  \ For a complete list of current and past activity for all volcanoes on the planet
  active during the last 10,000 years, please see Smithsonian Institution's Global
  Volcanism Program (GVP).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
